contracts/DisSess-SeeMe.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

contract PeerDiscovery {
    // Struct to represent a peer
    struct Peer {
        bool isOnline;
        address peerAddress;
        string[] capabilities; // Audio and video codecs supported
        mapping(uint256 => Session) sessions; // Mapping of session IDs to session details
        uint256 sessionCount; // Counter for the number of sessions
    }

    // Struct to represent a session
    struct Session {
        address initiator;
        address responder;
        uint256 startTime;
        uint256 endTime;
        string sessionData; // Placeholder for session metadata
        bool isActive;
    }

    // Mapping of peer addresses to their details
    mapping(address => Peer) public peers;

    // Event to notify when a peer comes online
    event PeerOnline(address peerAddress);

    // Event to notify when a peer goes offline
    event PeerOffline(address peerAddress);

    // Event to notify when a session is initiated
    event SessionInitiated(uint256 sessionId, address initiator, address responder, uint256 startTime);

    // Event to notify when a session is ended
    event SessionEnded(uint256 sessionId, uint256 endTime);

    // Function to register a peer when they come online
    function registerPeer(string[] memory _capabilities) public {
        peers[msg.sender].isOnline = true;
        peers[msg.sender].peerAddress = msg.sender;
        peers[msg.sender].capabilities = _capabilities;
        emit PeerOnline(msg.sender);
    }

    // Function to unregister a peer when they go offline
    function unregisterPeer() public {
        peers[msg.sender].isOnline = false;
        emit PeerOffline(msg.sender);
    }

    // Function to initiate a session with another peer
    function initiateSession(address _peerAddress, string memory _sessionData) public {
        require(peers[msg.sender].isOnline && peers[_peerAddress].isOnline, "Both peers must be online");
        
        uint256 sessionId = peers[msg.sender].sessionCount++;
        peers[msg.sender].sessions[sessionId] = Session(msg.sender, _peerAddress, block.timestamp, 0, _sessionData, true);
        peers[_peerAddress].sessions[sessionId] = Session(msg.sender, _peerAddress, block.timestamp, 0, _sessionData, true);
        
        emit SessionInitiated(sessionId, msg.sender, _peerAddress, block.timestamp);
    }

    // Function to end a session
    function endSession(uint256 _sessionId) public {
        require(peers[msg.sender].sessions[_sessionId].isActive, "Session is not active");
        
        peers[msg.sender].sessions[_sessionId].isActive = false;
        peers[msg.sender].sessions[_sessionId].endTime = block.timestamp;
        
        address responder = peers[msg.sender].sessions[_sessionId].responder;
        peers[responder].sessions[_sessionId].isActive = false;
        peers[responder].sessions[_sessionId].endTime = block.timestamp;
        
        emit SessionEnded(_sessionId, block.timestamp);
    }
}

